import React from 'react';

const Header = () => {
  return (
    <header className="bg-black text-white p-4 flex items-center">
      <input
        type="text"
        placeholder="Search"
        className="bg-gray-800 text-white p-2 rounded w-1/3"
      />
    </header>
  );
};

export default Header;
